// Car Rental Management System - Fixed Version
const { useState, useEffect, useContext, createContext, useCallback } = React;
const { createRoot } = ReactDOM;

// Mock data
const mockData = {
  cars: [
    {
      id: 1,
      make: "Toyota",
      model: "Camry",
      year: 2024,
      type: "sedan",
      seats: 5,
