      rating: 4.8,
      description: "Reliable and fuel-efficient hybrid sedan perfect for city driving and long trips."
    },
    {
      id: 2,
      make: "BMW",
      model: "X3",
      year: 2024,
      type: "suv",
      seats: 5,
